INSERT INTO technologies (id, drug_id, cooking_time, amount, description) VALUES (1, 12, '02:00:21', 50, 'О, нет, это не самолёты. Это Красота убила Чудовище.');
INSERT INTO technologies (id, drug_id, cooking_time, amount, description) VALUES (2, 11, '02:28:21', 70, 'REPL — форма организации простой интерактивной среды программирования в рамках средств интерфейса командной строки.');
INSERT INTO technologies (id, drug_id, cooking_time, amount, description) VALUES (3, 18, '02:49:59', 50, 'А вот и Джонни!');
INSERT INTO technologies (id, drug_id, cooking_time, amount, description) VALUES (4, 14, '00:23:56', 70, 'Полнотиповое программирование может поддерживаться на уровне системы типов языка или вводиться программистом идиоматически.');
INSERT INTO technologies (id, drug_id, cooking_time, amount, description) VALUES (5, 2, '03:09:49', 20, 'Python поддерживает несколько парадигм программирования, в том числе структурное, объектно-ориентированное, функциональное, императивное и аспектно-ориентированное.');
INSERT INTO technologies (id, drug_id, cooking_time, amount, description) VALUES (6, 12, '01:30:34', 50, 'прийтись ударить прозрачный приниматься непосредственно необыкновенный');
INSERT INTO technologies (id, drug_id, cooking_time, amount, description) VALUES (7, 17, '02:47:37', 70, 'разумный музыка принести отсюда встать');
INSERT INTO technologies (id, drug_id, cooking_time, amount, description) VALUES (8, 14, '02:35:57', 10, 'Миссис Робинсон, вы пытаетесь меня соблазнить, не так ли?');
INSERT INTO technologies (id, drug_id, cooking_time, amount, description) VALUES (9, 18, '02:14:14', 60, 'Пластмассы[2]');
INSERT INTO technologies (id, drug_id, cooking_time, amount, description) VALUES (10, 16, '03:10:22', 10, 'Открой двери модуля, Хал');
INSERT INTO technologies (id, drug_id, cooking_time, amount, description) VALUES (11, 20, '02:37:21', 20, 'Является одним из самых распространённых языков программирования с поддержкой отложенных вычислений.');
INSERT INTO technologies (id, drug_id, cooking_time, amount, description) VALUES (12, 5, '01:33:31', 50, 'Парадигма программирования — это совокупность идей и понятий, определяющих стиль написания компьютерных программ.');
INSERT INTO technologies (id, drug_id, cooking_time, amount, description) VALUES (13, 12, '02:58:51', 70, 'REPL — форма организации простой интерактивной среды программирования в рамках средств интерфейса командной строки.');
INSERT INTO technologies (id, drug_id, cooking_time, amount, description) VALUES (14, 8, '01:47:14', 70, 'союз дорогой медведь заменить тронуть');
INSERT INTO technologies (id, drug_id, cooking_time, amount, description) VALUES (15, 18, '00:14:08', 10, 'Хьюстон, у нас проблема');
INSERT INTO technologies (id, drug_id, cooking_time, amount, description) VALUES (16, 8, '01:18:28', 90, 'Луи, мне кажется, это начало прекрасной дружбы');
INSERT INTO technologies (id, drug_id, cooking_time, amount, description) VALUES (17, 19, '01:35:55', 80, 'Полнотиповое программирование — стиль программирования, отличающийся обширным использованием информации о типах с тем, чтобы механизм проверки согласования типов обеспечил раннее выявление максимального количества всевозможных разновидностей багов.');
INSERT INTO technologies (id, drug_id, cooking_time, amount, description) VALUES (18, 5, '00:18:02', 90, 'цепь гроб строка мутный представиться собственность тащить глупость');
INSERT INTO technologies (id, drug_id, cooking_time, amount, description) VALUES (19, 18, '01:12:19', 30, 'Синтаксис ядра Python минималистичен.');
INSERT INTO technologies (id, drug_id, cooking_time, amount, description) VALUES (20, 11, '03:33:00', 10, 'наблюдать раз фуражка настроение тон заключаться причина казарма');
INSERT INTO technologies (id, drug_id, cooking_time, amount, description) VALUES (21, 1, '01:44:24', 60, 'Erlang является декларативным языком программирования, который скорее используется для описания того, что должно быть вычислено нежели как.');
INSERT INTO technologies (id, drug_id, cooking_time, amount, description) VALUES (22, 14, '03:49:20', 50, 'Открой двери модуля, Хал');
INSERT INTO technologies (id, drug_id, cooking_time, amount, description) VALUES (23, 2, '01:56:57', 90, 'Покажи мне деньги!');
INSERT INTO technologies (id, drug_id, cooking_time, amount, description) VALUES (24, 19, '02:09:11', 90, 'невероятный полицейский совершить каков необычный отчетливо слева доноситься');
INSERT INTO technologies (id, drug_id, cooking_time, amount, description) VALUES (25, 14, '02:23:55', 90, 'Приложения Java обычно транслируются в специальный байт-код, поэтому они могут работать на любой компьютерной архитектуре, с помощью виртуальной Java-машины.');
